    <h2 class="header">Page Source</h2>
    <pre><textarea class="page-source" readonly>overview: &#34;背中にハクチョウ属(//Cygnus//)と思われる翼が生えた人型実体が2体(以下EN-133-JP-A-1、EN-133-JP-A-2と表記)出現し、解読不可能の言語で会話を行いました。約6分間会話を続けた後、EN-133-JP-A-1が雑居ビルに設置されたカメラに向けて██県██市の座標が書かれた金属製の板を1分間掲げ、その後EN-133-JP-A-1とEN-133-JP-A-2は窓から外に飛翔しました。\n\nEN-133-JPの発生中、以下EN-133-JP-Aより半径1km圏内の生物は発声を行いませんでした。影響下にあった人物にインタビューを行った結果、「何となく喋ってはいけない気がした。」との証言が取れています。&#34;
